import React from "react";
import Link from "next/link";

const SearchSites = () => {
  return (
    <div>
      <div className="uk-grid-small" uk-grid="">
        <div>
          <Link href="/">
            <a className="uk-link-reset uk-text-bold">
              <span className="uk-icon" uk-icon="plus"></span>
              <span>Add Filter</span>
            </a>
          </Link>
        </div>
        <div>
          <form className="uk-search uk-search-small">
            <span uk-search-icon=""></span>
            <input
              className="uk-search-input"
              type="search"
              placeholder="Search..."
            />
          </form>
        </div>
      </div>
    </div>
  );
};

export default SearchSites;
